-30 12:28:38',NULL,'Compile data, compute fees and charges, and prepare invoices for billing purposes. Duties include computing costs and calculating rates for goods, services, and shipment of goods; posting data; and keeping other relevant records. May involve use of computer or typewriter, calculator, and adding and bookkeeping machines.'),(2160,'51-4011.00','Computer-Controlled Machine Tool Operators, Metal and Plastic',0,'2016-05-30 12:28:38',NULL,'Operate computer-controlled machines or robots to perform one or more machine functions on metal or plastic work pieces.'),(2161,'43-3021.01','Statement Clerks',0,'2016-05-30 12:28:38',NULL,'Prepare and distribute bank statements to customers, answer inquiries, and reconcile discrepancies in records and accounts.'),(2162,'43-3021.00','Billing and Posting Clerks',0,'2016-05-30 12:28:38',NULL,'Compile, compute, and record billing, accounting, statistical, and other numerical data for billing purposes. Prepare billing invoices for services rendered or for delivery or shipment of goods.'),(2163,'45-3011.00','Fishers and Related Fishing Workers',0,'2016-05-30 12:28:38',NULL,'Use nets, fishing rods, traps, or other equipment to catch and gather fish or other aquatic animals from rivers, lakes, or oceans, for human consumption or other uses. May haul game onto ship.'),(2164,'43-4171.00','Receptionists and Information Clerks',0,'2016-05-30 12:28:38',NULL,'Answer inquiries and provide information to the general public, customers, visitors, and other interested parties regarding activities conducted at establishment and location of departments, offices, and employees within the organization.'),(2165,'51-3011.00','Bakers',0,'2016-05-30 12:28:38',NULL,'Mix and bake ingredients to produce breads, rolls, cookies, cakes, pies, pastries, or other baked goods.'),(2166,'43-9061.00','Office Clerks, General',0,'2016-05-30 12:28:38',NULL,'Perform duties too varied and diverse to be classified in any specific office clerical occupation, requiring knowledge of office systems and procedures. Clerical duties may be assigned in accordance with the office procedures of individual establishments and may include a combination of answering telephones, bookkeeping, typing or word processing, stenography, office machine operation, and filing.'),(2167,'51-4033.00','Grinding, Lapping, Polishing, and Buffing Machine Tool Setters, Operators, and Tenders, Metal and Plastic',0,'2016-05-30 12:28:38',NULL,'Set up, operate, or tend grinding and related tools that remove excess material or burrs from surfaces, sharpen edges or corners, or buff, hone, or polish metal or plastic work pieces.'),(2168,'49-9096.00','Riggers',0,'2016-05-30 12:28:38',NULL,'Set up or repair rigging for construction projects, manufacturing plants, logging yards, ships and shipyards, or for the entertainment industry.'),(2169,'51-6021.00','Pressers, Textile, Garment, and Related Materials',0,'2016-05-30 12:28:38',NULL,'Press or shape articles by hand or machine.'),(2170,'51-7099.00','Woodworkers, All Other',0,'2016-05-30 12:28:38',NULL,'All woodworkers not listed separately.'),(2171,'53-7072.00','Pump Operators, Except Wellhead Pumpers',0,'2016-05-30 12:28:38',NULL,'Tend, control, or operate power-driven, stationary, or portable pumps and manifold systems to transfer gases, oil, other liquids, slurries, or powdered materials to and from various vessels and processes.'),(2172,'29-2031.00','Cardiovascular Technologists and Technicians',0,'2016-05-30 12:28:38',NULL,'Conduct tests on pulmonary or cardiovascular systems of patients for diagnostic purposes. May conduct or assist in electrocardiograms, cardiac catheterizations, pulmonary functions, lung capacity, and similar tests. Includes vascular technologists.'),(2173,'43-4021.00','Correspondence Clerks',0,'2016-05-30 12:28:38',NULL,'Compose letters or electronic correspondence in reply to requests for merchandise, damage claims, credit and other information, delinquent accounts, incorrect billings, or unsatisfactory services. Duties may include gathering data to formulate reply and preparing correspondence.'),(2174,'43-1011.00','First-Line Supervisors of Office and Administrative Support Workers',0,'2016-05-30 12:28:38',NULL,'Directly supervise and coordinate the activities of clerical and administrative support workers.'),(2175,'51-3092.00','Food Batchmakers',0,'2016-05-30 12:28:38',NULL,'Set up and operate equipment that mixes or blends ingredients used in the manufacturing of food products. Includes candy makers and cheese makers.'),(2176,'45-4011.00','Forest and Conservation Workers',0,'2016-05-30 12:28:38',NULL,'Under supervision, perform manual labor necessary to develop, maintain, or protect areas such as forests, forested areas, woodlands, wetlands, and rangelands through such activities as raising and transporting seedlings; combating insects, pests, and diseases harmful to plant life; and building structures to control water, erosion, and leaching of soil. Includes forester aides, seedling pullers, and tree planters.'),(2177,'29-1051.00','Pharmacists',0,'2016-05-30 12:28:38',NULL,'Dispense drugs prescribed by physicians and other health practitioners and provide information to patients about medications and their use. May advise physicians and other health practitioners on the selection, dosage, interactions, and side effects of medications.'),(2178,'51-8031.00','Water and Wastewater Treatment Plant and System Operators',0,'2016-05-30 12:28:38',NULL,'Operate or control an entire process or system of machines, often through the use of control boards, to transfer or treat water or wastewater.'),(2179,'51-9011.00','Chemical Equipment Operators and Tenders',0,'2016-05-30 12:28:38',NULL,'Operate or tend equipment to control chemical changes or reactions in the processing of industrial or consumer products. Equipment used includes devulcanizers, steam-jacketed kettles, and reactor vessels.'),(2180,'53-7199.00','Material Moving Workers, All Other',0,'2016-05-30 12:28:38',NULL,'All material moving workers not listed separately.'),(2181,'43-2099.00','Communications Equipment Operators, All Other',0,'2016-05-30 12:28:38',NULL,'All communications equipment operators not listed separately.'),(2182,'29-2051.00','Dietetic Technicians',0,'2016-05-30 12:28:38',NULL,'Assist in the provision of food service and nutritional programs, under the supervision of a dietitian. May plan and produce meals based on established guidelines, teach principles of food and nutrition, or counsel individuals.'),(2183,'51-2023.00','Electromechanical Equipment Assemblers',0,'2016-05-30 12:28:38',NULL,'Assemble or modify electromechanical equipment or devices, such as servomechanisms, gyros, dynamometers, magnetic drums, tape drives, brakes, control linkage, actuators, and appliances.'),(2184,'37-2021.00','Pest Control Workers',0,'2016-05-30 12:28:38',NULL,'Apply or release chemical solutions or toxic gases and set traps to kill or remove pests and vermin that infest buildings and surrounding areas.'),(2185,'37-3011.00','Landscaping and Groundskeeping Workers',0,'2016-05-30 12:28:38',NULL,'Landscape or maintain grounds of property using hand or power tools or equipment. Workers typically perform a variety of tasks, which may include any combination of the following: sod laying, mowing, trimming, planting, watering, fertilizing, digging, raking, sprinkler installation, and installation of mortarless segmental concrete masonry wall units.'),(2186,'39-5092.00','Manicurists and Pedicurists',0,'2016-05-30 12:28:38',NULL,'Clean and shape customers\' fingernails and toenails. May polish or decorate nails.'),(2187,'51-8011.00','Nuclear Power Reactor Operators',0,'2016-05-30 12:28:38',NULL,'Operate or control nuclear reactors. Move control rods, start and stop equipment, monitor and adjust controls, and record data in logs. Implement emergency procedures when needed. May respond to abnormalities, determine cause, and recommend corrective action.'),(2188,'43-2021.00','Telephone Operators',0,'2016-05-30 12:28:38',NULL,'Provide information by accessing alphabetical, geographical, or other directories. Assist customers with special billing requests, such as charges to a third party and credits or refunds for incorrectly dialed numbers or bad connections. May handle emergency calls and assist children or people with physical disabilities to make telephone calls.'),(2189,'55-3019.00','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members, All Other',0,'2016-05-30 12:28:38',NULL,'All military enlisted tactical operations and air/weapons specialists and crew members not listed separately.'),(2190,'43-5041.00','Meter Readers, Utilities',0,'2016-05-30 12:28:38',NULL,'Read meter and record consumption of electricity, gas, water, or steam.'),(2191,'51-4035.00','Milling and Planing Machine Setters, Operators, and Tenders, Metal and Plastic',0,'2016-05-30 12:28:38',NULL,'Set up, operate, or tend milling or planing machines to mill, plane, shape, groove, or profile metal or plastic work pieces.'),(2192,'45-4023.00','Log Graders and Scalers',0,'2016-05-30 12:28:38',NULL,'Grade logs or estimate the marketable content or value of logs or pulpwood in sorting yards, millpond, log deck, or similar locations. Inspect logs for defects or measure logs to determine volume.'),(2193,'49-3022.00','Automotive Glass Installers and Repairers',0,'2016-05-30 12:28:38',NULL,'Replace or repair broken windshields and window glass in motor vehicles.'),(2194,'29-1063.00','Internists, General',0,'2016-05-30 12:28:38',NULL,'Physicians who diagnose and provide non-surgical treatment of diseases and injuries of internal organ systems. Provide care mainly for adults who have a wide range of problems associated with the internal organs.'),(2195,'47-5049.00','Mining Machine Operators, All Other',0,'2016-05-30 12:28:38',NULL,'All mining machine operators not listed separately.'),(2196,'51-2092.00','Team Assemblers',0,'2016-05-30 12:28:38',NULL,'Work as part of a team having responsibility for assembling an entire product or component of a product. Team assemblers can perform all tasks conducted by the team in the assembly process and rotate through all or most of them rather than being assigned to a specific task on a permanent basis. May participate in making management decisions affecting the work. Includes team leaders who work as part of the team.'),(2197,'51-7021.00','Furniture Finishers',0,'2016-05-30 12:28:38',NULL,'Shape, finish, and refinish damaged, worn, or used furniture or new high-grade furniture to specified color or finish.'),(2198,'43-9051.00','Mail Clerks and Mail Machine Operators, Except Postal Service',0,'2016-05-30 12:28:38',NULL,'Prepare incoming and outgoing mail for distribution. Use hand or mail handling machines to time stamp, open, read, sort, and route incoming mail; and address, seal, stamp, fold, stuff, and affix postage to outgoing mail or packages. Duties may also include keeping necessary records and completed forms.'),(2199,'51-9021.00','Crushing, Grinding, and Polishing Machine Setters, Operators, and Tenders',0,'2016-05-30 12:28:38',NULL,'Set up, operate, or tend machines to crush, grind, or polish materials, such as coal, glass, grain, stone, food, or rubber.'),(2200,'43-4181.00','Reservation and Transportation Ticket Agents and Travel Clerks',0,'2016-05-30 12:28:38',NULL,'Make and confirm reservations for transportation or lodging, or sell transportation tickets. May check baggage and direct passengers to designated concourse, pier, or track; deliver tickets, contact individuals and groups to inform them of package tours; or provide tourists with travel or transportation information.'),(2201,'51-6011.00','Laundry and Dry-Cleaning Workers',0,'2016-05-30 12:28:38',NULL,'Operate or tend washing or dry-cleaning machines to wash or dry-clean industrial or household articles, such as cloth garments, suede, leather, furs, blankets, draperies, linens, rugs, and carpets. Includes spotters and dyers of these articles.'),(2202,'51-4023.00','Rolling Machine Setters, Operators, and Tenders, Metal and Plastic',0,'2016-05-30 12:28:38',NULL,'Set up, operate, or tend machines to roll steel or plastic forming bends, beads, knurls, rolls, or plate or to flatten, temper, or reduce gauge of material.'),(2203,'49-9064.00','Watch Repairers',0,'2016-05-30 12:28:38',NULL,'Repair, clean, and adjust mechanisms of timing instruments, such as watches and clocks. Includes watchmakers, watch technicians, and mechanical timepiece repairers.'),(2204,'37-1011.00','First-Line Supervisors of Housekeeping and Janitorial Workers',0,'2016-05-30 12:28:38',NULL,'Directly supervise and coordinate work activities of cleaning personnel in hotels, hospitals, offices, and other establishments.'),(2205,'43-3031.00','Bookkeeping, Accounting, and Auditing Clerks',0,'2016-05-30 12:28:38',NULL,'Compute, classify, and record numerical data to keep financial records complete. Perform any combination of routine calculating, posting, and verifying duties to obtain primary financial data for use in maintaining accounting records. May also check the accuracy of figures, calculations, and postings pertaining to business transactions recorded by other workers.'),(2206,'29-1041.00','Optometrists',0,'2016-05-30 12:28:38',NULL,'Diagnose, manage, and treat conditions and diseases of the human eye and visual system. Examine eyes and visual system, diagnose problems or impairments, prescribe corrective lenses, and provide treatment. May prescribe therapeutic drugs to treat specific eye conditions.'),(2207,'49-2022.00','Telecommunications Equipment Installers and Repairers, Except Line Installers',0,'2016-05-30 12:28:38',NULL,'Install, set-up, rearrange, or remove switching, distribution, routing, and dialing equipment used in central offices or headends. Service or repair telephone, cable television, Internet, and other communications equipment on customers\' property. May install communications equipment or communications wiring in buildings.'),(2208,'51-3023.00','Slaughterers and Meat Packers',0,'2016-05-30 12:28:38',NULL,'Work in slaughtering, meat packing, or wholesale establishments performing precision functions involving the preparation of meat. Work may include specialized slaughtering tasks, cutting standard or premium cuts of meat for marketing, making sausage, or wrapping meats.'),(2209,'45-2092.02','Farmworkers and Laborers, Crop',0,'2016-05-30 12:28:38',NULL,'Manually plant, cultivate, and harvest vegetables, fruits, nuts and field crops. Use hand tools, such as shovels, trowels, hoes, tampers, pruning hooks, shears, and knives. Duties may include tilling soil and applying fertilizers; transplanting, weeding, thinning, or pruning crops; applying pesticides; cleaning, packing, and loading harvested products. May construct trellises, repair fences and farm buildings, or participate in irrigation activities.'),(2210,'45-2092.01','Nursery Workers',0,'2016-05-30 12:28:38',NULL,'Work in nursery facilities or at customer location planting, cultivating, harvesting, and transplanting trees, shrubs, or plants.'),(2211,'45-2092.00','Farmworkers and Laborers, Crop, Nursery, and Greenhouse',0,'2016-05-30 12:28:38',NULL,'Manually plant, cultivate, and harvest vegetables, fruits, nuts, horticultural specialties, and field crops. Use hand tools, such as shovels, trowels, hoes, tampers, pruning hooks, shears, and knives. Duties may include tilling soil and applying fertilizers; transplanting, weeding, thinning, or pruning crops; applying pesticides; or cleaning, grading, sorting, packing, and loading harvested products. May construct trellises, repair fences and farm buildings, or participate in irrigation activities.'),(2212,'29-2041.00','Emergency Medical Technicians and Paramedics',0,'2016-05-30 12:28:38',NULL,'Assess injuries, administer emergency medical care, and extricate trapped individuals. Transport injured or sick persons to medical facilities.'),(2213,'43-5053.00','Postal Service Mail Sorters, Processors, and Processing Machine Operators',0,'2016-05-30 12:28:38',NULL,'Prepare incoming and outgoing mail for distribution. Examine, sort, and route mail. Load, operate, and occasionally adjust and repair mail processing, sorting, and canceling machinery. Keep records of shipments, pouches, and sacks; and other duties related to mail handling within the postal service.'),(2214,'43-4031.00','Court, Municipal, and License Clerks',0,'2016-05-30 12:28:38',NULL,'Perform clerical duties for courts of law, municipalities, or governmental licensing agencies and bureaus. May prepare docket of cases to be called; secure information for judges and court; prepare draft agendas or bylaws for town or city council; answer official correspondence; keep fiscal records and accounts; issue licenses or permits; and record data, administer tests, or collect fees.'),(2215,'43-4031.01','Court Clerks',0,'2016-05-30 12:28:38',NULL,'Perform clerical duties in court of law; prepare docket of cases to be called; secure information for judges; and contact witnesses, attorneys, and litigants to obtain information for court.'),(2216,'51-9193.00','Cooling and Freezing Equipment Operators and Tenders',0,'2016-05-30 12:28:38',NULL,'Operate or tend equipment, such as cooling and freezing units, refrigerators, batch freezers, and freezing tunnels, to cool or freeze products, food, blood plasma, and chemicals.'),(2217,'47-2111.00','Electricians',0,'2016-05-30 12:28:38',NULL,'Install, maintain, and repair electrical wiring, equipment, and fixtures. Ensure that work is in accordance with relevant codes. May install or service street lights, intercom systems, or electrical control systems.'),(2218,'31-9096.00','Veterinary Assistants and Laboratory Animal Caretakers',0,'2016-05-30 12:28:38',NULL,'Feed, water, and examine pets and other nonfarm animals for signs of illness, disease, or injury in laboratories and animal hospitals and clinics. Clean and disinfect cages and work areas, and sterilize laboratory and surgical equipment. May provide routine post-operative care, administer medication orally or topically, or prepare samples for laboratory examination under the supervision of veterinary or laboratory animal technologists or technicians, veterinarians, or scientists.'),(2219,'43-4031.02','Municipal Clerks',0,'2016-05-30 12:28:38',NULL,'Draft agendas and bylaws for town or city council; record minutes of council meetings; answer official correspondence; keep fiscal records and accounts; and prepare reports on civic needs.'),(2220,'43-4031.03','License Clerks',0,'2016-05-30 12:28:38',NULL,'Issue licenses or permits to qualified applicants. Obtain necessary information, record data, advise applicants on requirements, collect fees, and issue licenses. May conduct oral, written, visual, or performance testing.');

