/*!50003 CREATE DEFINER=`root`@`127.0.0.1` FUNCTION `updateStatus`(jobFerNo Varchar(50),decision char(1)) RETURNS int(11)
BEGIN                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   
